                        	<h1>The List of Chat Acronyms & Text Message Shorthand</h1>
                        </div>   
                        <div class="right">
							<a href="javascript:window.print()"><img src="http://www.netlingo.com/images/ico_printer_small.gif" width="20" height="17" alt="Print this page" /></a>
