               	  <div class="body">
                    <p>With more than 82 million people <a href="http://www.netlingo.com/word/texting.php">texting</a> regularly, it's no wonder you've seen this cryptic looking code! <br />
Commonly used wherever people get online -- including <a href="http://www.netlingo.com/word/instant-messaging.php">IMing</a>, <a href="http://www.netlingo.com/word/sms.php">SMSing</a>, <a href="http://www.netlingo.com/word/cell-phone.php">cell phones</a>, <a href="http://www.netlingo.com/word/crackberry.php">Blackberries</a>, <a href="http://www.netlingo.com/word/pda.php">PDAs</a>, <a href="http://www.netlingo.com/word/Web-site.php">Web sites</a>, <a href="http://www.netlingo.com/word/gamer.php">games</a>, <a href="http://www.netlingo.com/word/newsgroups.php">newsgroup postings</a>, <a href="http://www.netlingo.com/word/chat-room.php">in chat rooms</a>, <a href="http://www.netlingo.com/word/blog.php">on blogs</a> -- these abbreviations are used by people to communicate with each other. <a href="#definition">The actual definition of an acronym and text shorthand is here.</a>                    </p>
                    <div class="note">
                            <p>Note: "C" and "S" are used interchangeably for "See" --and-- "U" and "Y" are used interchangeably for "You" </p>
