                    <h1>The List of Chat Acronyms & Text Message Shorthand</h1>
                    <a name="definition"></a>
					<p>Acronyms have always been an integral part of computer culture, and they have   since spawned a new language on the Internet. Commonly thought of as a series of   letters that make up a 'word' there is a distinction between <a href="http://www.netlingo.com/word/chat-acronym-or-chat-acronyms.php">acronyms</a> and <a href="http://www.netlingo.com/word/shorthand.php">shorthand</a>. </p>
        <p>Online enthusiasts, primarily <a href="http://www.netlingo.com/word/gen-Y.php">millennials</a>, are   learning that shorthand are in fact called acronyms, but this is incorrect. The   difference between acronyms and shorthand is that with acronyms, <em>you   pronounce the letters as a new word</em> (for example, 'FUBAR' is pronounced   'foo-bar' and 'RADAR' is pronounced 'ray-dar'). In contrast, shorthand   pronunciations are like an initialism (a set of initials) in which you <em>say   the letters one-by-one</em> (for example, 'ESP' is an initialism for 'extra   sensory perception' whereas 'esp. is an abbreviation for especially). The   online practice is to refer to shorthand, initialisms, or abbreviations as   acronyms.</p>
        <p>The majority of the expressions you see above are not acronyms, but rather   shorthand used while <a href="http://www.netlingo.com/word/texting.php">text messaging</a> or <a href="http://www.netlingo.com/word/instantmessaging.php">IMing</a>. BTW: If you ever see someone TYPING AN ENTIRE SENTENCE IN ALL CAPITAL LETTERS   that means SHOUTING! It is not proper <a href="http://www.netlingo.com/word/netiquette.php">netiquette</a> to TYPE   IN ALL CAPS (even in email), in fact, it's annoying. People with limited   eyesight may use all caps to see the words better, but otherwise, TURN THE CAPS   LOCK OFF, <em>unless you're using an acronym or shorthand.</em></p>                    <p><strong>Got a favorite one you don't see here? <A href="mailto:info@netlingo.com?Subject=Acronym/Shorthand suggestion">Suggest an   acronym or shorthand!</A></strong> <BR>
